import React from "react";
import "./NavBar.css";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="main">
      <Link href="/home">
        <img className="logo" src="./images/Twenteefore - Logo 2.png" />
      </Link>
      <nav className="navbar">
        {/* <li className="li"> */}
          {" "}
          <Link className="homeLink" to="/">
            Home
          </Link>
        {/* </li> */}
        {/* <li className="li"> */}
          <Link className="orderLink" to="/">
            Order
          </Link>
        {/* </li> */}
        {/* <li className="li"> */}
          <Link className="leaderboardsLink" to="/">
            Leaderboards
          </Link>
        {/* </li> */}
        {/* <li className="li"> */}
          {" "}
          <Link className="marketplaceLink" href="/">
            Marketplace
          </Link>
        {/* </li> */}
        {/* <li className="li"> */}
          {" "}
          <Link className="faqsLink" href="/faqs">
            FAQs
          </Link>
        {/* </li> */}
      </nav>
      <a className="loginLink" href="/login">
        <button id="loginLink">Log In</button>
      </a>
    </div>
  );
};
export default NavBar;
